import React from "react";
import { Outlet, useSearchParams } from "react-router-dom";

const Users = () => {
  const [searchparam, setSearchParam] = useSearchParams();
  return (
    <>
      <div>
        <h2>User 1</h2>
        <h2>User 2</h2>
        <h2>User 3</h2>
        <Outlet />

        <button
          onClick={() => {
            setSearchParamm({ filter: "active" });
          }}
        >
          Active user
        </button>
        <button
          onClick={() => {
            setSearchParamm({});
          }}
        >
          Reset Filter
        </button>
      </div>
    </>
  );
};

export default Users;
